// Optional: filter UI
import { useEffect, useState } from 'react';
import axios from 'axios';

function CustomReport() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/fleet/custom?vehicleId=&routeId=')
      .then(res => setData(res.data));
  }, []);

  return (
    <div>
      <h2>Custom Report</h2>
      {data.map((d, i) => (
        <div key={i}>
          <p>Driver: {d.vehicle.driverName}</p>
          <p>Route: {d.route.sourceCity} → {d.route.destinationCity}</p>
          <p>Total Cost: ₹{d.totalCost.toFixed(2)}</p>
        </div>
      ))}
    </div>
  );
}
export default CustomReport;
